import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";


const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <>
      {array.map((element) => {
        return <Button variant="text">{element}</Button>;
      })}

<Paper sx={{ borderRadius: "25px" }} elevation={5}>
        <Box p={1}>
          <Typography variant="h5">custom border radius</Typography>
        </Box>
      </Paper>
      <Grid container spacing={2}>
        <Grid backgroundColor="red" item xs={8}>
          xs=8
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={8}>
          xs=8
        </Grid>
      </Grid>
   
    </>
  );
}

export default Home;
